import React from 'react'

// MuiComponent
import {Dialog as MuiDialog} from '@material-ui/core'
import { DialogTitle } from '@material-ui/core'
import {DialogContent} from '@material-ui/core'
import {Typography} from '@material-ui/core'
import {Grid} from '@material-ui/core'
import {TextField} from '@material-ui/core'
import { makeStyles } from '@material-ui/styles'
import {GlobalContext} from '../../ContextApi'

const useStyles = makeStyles(theme=> ({
  paper: {
    position: 'absolute',
    top: 0,
  },
  textField : {
    margin: theme.spacing(1)
  },

  input: {
   margin: theme.spacing(1) 
  }

}))



function Dialog({open, setClose}) {
  const {profile, loading} = GlobalContext()
  const [profileInput, setProfileInput] = React.useState(profile)
  const classes = useStyles()


  const handleChange = (e) => {
    const {name, value} = e.target
    setProfileInput(prevState => {
      return {...prevState, [name]: value}
    })
  }

  React.useEffect(() => {
    setProfileInput(profile)
  }, [loading])


  return (
    <MuiDialog 
      open={true}
      maxWidth="sm"
      onClose={()=>setClose(false)}
      classes = {{paper: classes.paper}}
    >
      <DialogTitle>
        <Typography
         align="right"
        >
          X
        </Typography>
      </DialogTitle>

      <DialogContent>
        <Grid container justify="center" >
              <Grid item xs={12}>
                <TextField 
                  fullWidth
                  size="small"
                  variant="outlined"
                  name="name"
                  label="name"  
                  value={profileInput.name}
                  className={classes.textField}
                  onChange={handleChange}
                />
                <TextField 
                  fullWidth
                  size="small"
                  variant="outlined"
                  name="description"
                  label="description"  
                  value={profileInput.description}
                  className={classes.textField}
                  onChange={handleChange}
                  multiline
                  rows={5}
                />
                <input
                  type="file"
                  accept='.jpeg/*'
                  className={classes.input}
                  value={profileInput.resume}
                  onChange={handleChange}
                />
                <input
                  type="file"
                  accept='.jpeg/*'
                  className={classes.input}

                />

              </Grid>










        </Grid>



      </DialogContent>

    </MuiDialog>
  )
}

export default Dialog
